import { Nav } from 'react-bootstrap';

function Navi () {
    return (
        <Nav activeKey="/home">
            <Nav.Item>
                <Nav.Link href="/home">Home</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="/order">Orders</Nav.Link>
            </Nav.Item>
        </Nav>
    );
}

export default Navi;
